description:
BMW 320GT Luxury Line:

Вашему вниманию мой личный автомобиль. Первый владелец в СНГ. Машина из Мюнхена, подбирал и привозил собственноручно - плохую бы не купил :)
По запросу готов предоставить свежий отчёт BMW Air. 

Двигатель B47 на 190 л.с. Надёжный, шустрый и неприхотливый агрегат.

Автомобиль обслуживается своевременно и только дорогими материалами: 
- 1200км назад заменено по регламенту масло в двигателе (синтетика Mobil);
- 2000км произведена замена масла в коробке (с заменой поддона);
- На пробеге 150к км был заменён впуск. С целью минимизации риска облома пластиковых заслонок, произведена замена, а не чистка. Старый отдам вместе с автомобилем.

Исполнение Luxury Line. Белый жемчуг с расширенным пакетом хрома. Очень богатая и довольно редкая комплектация среди третьей серии марки:

- Спортивные сиденья с поддержками и памятью;

- Адаптивные LED фары + туманки (авто ближний\дальний, поворот пучка света вместе с рулём);

- Адаптивный круиз с дистроником;

- Система контроля полосы;

- Система экстренного торможения;

- Контроль мёртвых зон;

- Подогревы перед\зад;

- Подогрев руля;

- Проекция на лобовое;

- Контурная подсветка салона;

- Большой сенсорный монитор с сенсорной увеличенной шайбой (NBT Evo);

- Музыка Hi-Fi Stereo с двумя буферами под передними сиденьями (предмаксимальная);

- Камеры зад + 360;

- Открытие багажника жестом ноги;

- Увеличенный ЖК монитор на приборной панели;

- Стёкла AS3;

- Беcключевой доступ;

- Торпедо в коже

Помимо вышеперечисленного, приятные бонусы к автомобилю:
1) Продаётся на оригинальных М-дисках (400ый стиль) R18, на новой летней резине Continental.
2) Отдам второй комплект зимних дисков R17 на резине (фото прилагаю в конце карусели).
3) Автомобиль с момента приобретения и по сей день частично оклеен премиальной защитной плёнкой.
4) Два комплекта ковриков зима\лето.

В остальном всё видно на фотографиях. За автомобиль не стыдно
Автосалоны/площадки и т.д. просьба не беспокоить!

*если будет необходимость, предоставлю таможенный комплект на РФ.

